import React from "react";
import "./HomePage.styles.css";

function HomePage() {
  return (
    <div className="homepage">
      <div className="dashboard-grid-container">
        <div className="dashboard-grid-item">1</div>
        <div className="dashboard-grid-item">2</div>
        <div className="dashboard-grid-item">3</div>
        <div className="dashboard-grid-item">4</div>
        <div className="dashboard-grid-item">5</div>
        <div className="dashboard-grid-item">6</div>
        <div className="dashboard-grid-item">7</div>
        <div className="dashboard-grid-item">8</div>
      </div>
    </div>
  );
}

export default HomePage;
